import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
    {
        id: "e1",
        title: "Some event"
    },
    {
        id: "e2",
        title: "Another event"
    }
];

const EventsPage = () => {
    return (
        <>
            <h1>EventsPage</h1>
            <ul>
                {DUMMY_EVENTS.map(event =>
                    <li key={event.id}>
                        {/* <Link to={`/events/${event.id}`}></Link> */}
                        {/*OR :-*/}
                        <Link to={event.id}></Link>
                    </li>
                )}
            </ul>
        </>
    );
}

export default EventsPage;
